export default function user(state ={user:[], token:{}}, action) {
    switch(action.type) {
        case "newUser": {
            state = {...state, authors:action.payload}
            break;
        }
        case 'isLogin': {
            state = {...state , books:action.payload}
            break;
        }
        default : {

        }
    }
    return state;
}
